
const request = require('supertest');
const { options } = require('./app');
const app = require('./app');

describe('Tests the server service',() => {
    test('GET /group suceeds', () => {
        return request(app)
        .get('/group')
        .expect(200)
    
    });
    test('GET /group returns json',() =>{
        return request(app)
        .get('/group')
        .expect('content-type',/json/) 
    });
    test('GET /display/:gID suceeds', () =>{
            return request(app)
            .get('/display/1')
            .expect(200)
        
        });
    test('GET /group returns json',() =>{
            return request(app)
            .get('/display/1')
            .expect('content-type',/json/) 
        });
    test('POST /newGroup suceeds',()=>{
        const options = {"name" : "Test Group"}
        return request(app)
        .post('/newGroup')
        .send(options)
        .expect(200)
    });
    test('GET /newLeader suceeds',()=>{
         const options = {"groupID": 1, "name": "Testy", "section": "cubs", "role": "testRole", "photo":  "data:image/jpeg;base64," }
     return request(app)
     .post('/newLeader')
     .send(options)
     .expect(200)
     })

    })
